		this.removePlus = function (plname) {
			var iX;
			
			for (var i = 0; i < exportRoot.gamemc.plArray.length; i++) {
				if (exportRoot.gamemc.plArray[i].name == plname) {
					iX =exportRoot.gamemc.plArray.indexOf(exportRoot.gamemc.plArray[i]);
					exportRoot.gamemc.removeChild(exportRoot.gamemc.plArray[i]);
					exportRoot.gamemc.plArray.splice((iX), 1);
				}
			}
		}
		
		
		
		
		function addNewStuff(lor) {
			var stuff = new lib.stuffmc();
			var stuffSpeed = Math.round(Math.random() * (exportRoot.gamemc.speedMax - exportRoot.gamemc.speedMin)) + exportRoot.gamemc.speedMin;
			var stuffframe = Math.round(Math.random() * (exportRoot.gamemc.stuffframeAll - 1)) + 1;
			stuff.gotoAndStop(stuffframe);
			if (lor == 1) {
				stuff.x = 800;
			} else {
				stuff.x = 264;
			}
		
			stuff.y = 20;
			
			stuff.caught=false;
		
			exportRoot.gamemc.addChild(stuff);
			exportRoot.gamemc.stuffArray.push(stuff);
		}
		
		//удаляем stuff
		function removeStuff(stuff) {
		
			var roundEnd = false;
			var iX;
			if (stuff.visible) {
				roundEnd = true;
				
				if (stuff.x>626) {
					exportRoot.gamemc.min1.gotoAndPlay(2);
				} 
				else
				{
					exportRoot.gamemc.min2.gotoAndPlay(2);
				}
			}
		
		
			iX = exportRoot.gamemc.stuffArray.indexOf(stuff);
			exportRoot.gamemc.removeChild(stuff);
			exportRoot.gamemc.stuffArray.splice((iX), 1);
		
			if (roundEnd) {
				if (exportRoot.gamemc.inGame) {
					for (i = 0; i < exportRoot.gamemc.stuffArray.length; i++) {
						exportRoot.gamemc.stuffArray[i].visible = false;
					}
					exportRoot.gamemc.inGame = false;
					stopRound();
				} else {
					for (i = 0; i < exportRoot.gamemc.stuffArray.length; i++) {
						exportRoot.gamemc.stuffArray[i].visible = false;
					}
				}
			}
		}
		
